import React, { Component } from 'react';

const caculatorBtnTextArray = ['7','8','9','+','4','5','6','-','1','2','3','X','C','0','=','%']

function CaculateBtn(props) {

  let toParent = (value) => props.parentMethod(value)

  return (
    caculatorBtnTextArray.map((value,index)=><a onClick={()=>toParent(value)} className="caculateBtnStyle" key={index}>{value}</a>)
  )
}

export default CaculateBtn;
